<script>
$(document).ready(function(){
  $(".modes a").click(function(e){
    e.preventDefault();
    var mode = jQuery(this).attr('data-mode');
    if(mode == "fullsize"){
      jQuery('.box_to_show').addClass('fullview');
      jQuery('.box_to_show').removeClass('desktop');
      jQuery('.box_to_show').removeClass('tablet');
      jQuery('.box_to_show').removeClass('mobile');
    }
    else if(mode == "landscape"){
      jQuery('.box_to_show').removeClass('fullview');
      jQuery('.box_to_show').addClass('desktop');
      jQuery('.box_to_show').removeClass('tablet');
      jQuery('.box_to_show').removeClass('mobile');
    } 
    else if(mode == "portrait"){
      jQuery('.box_to_show').removeClass('fullview');
      jQuery('.box_to_show').removeClass('desktop');
      jQuery('.box_to_show').addClass('tablet');
      jQuery('.box_to_show').removeClass('mobile');
    }
    else if(mode == "device"){
      jQuery('.box_to_show').removeClass('fullview');
      jQuery('.box_to_show').removeClass('desktop');
      jQuery('.box_to_show').removeClass('tablet');
      jQuery('.box_to_show').addClass('mobile');
    }
  });

});

function heartbeat() {
      clearTimeout(window.intervalID);
    $.ajax({
        url:    "<?=base_url()?>albums/heartbeat",
        type:   "post",
        cache:  false,
        data:{post_id:'<?=$id?>'},            
        dataType: 'json',
        success: function(data) {
        },
        complete: function() {
            window.intervalID = setTimeout(function() {
                heartbeat();    
            }, 8000); 
        }
    });
}

heartbeat();
</script>
